import React, { Component } from 'react'
import {Link} from 'react-router-dom';

 class Navbar extends Component {
  render() {
    return (
      <nav class="navbar bg-dark">
        <ul class="navbar-nav">
          <li class="nav-item">
            <Link class="nav-link text-light" to='/'>Search Dorms</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link  text-light" to='/'>My Dashboard</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link  text-light" to='/'>Login</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link text-light" to='/'>Sign Up</Link>
          </li>
        </ul>
      </nav>
    )
  }
}


export default Navbar;
